Lonely Planet Scandinavia is your passport to all the most relevant and up-to-date advice on what to see, what to skip and what hidden discoveries await you.

Cruise through Norway's majestic fjords, float in Iceland's Blue Lagoon or sample Copenhagen's finest new-Nordic cuisine; all with your trusted travel companion. Get to the heart of Scandinavia and begin your journey now!
